(8, 'Examen Físico', 'La exploración física o examen físico es el conjunto de procedimientos que realiza el médico al paciente, después de una correcta anamnesis en la entrevista clínica, para obtener un conjunto de datos objetivos o signos que estén relacionados con los síntomas que refiere el paciente. Con los datos de la exploración física reflejados en la historia clínica, se establece un diagnóstico o juicio clínico inicial a partir del cual se solicitan o no determinadas exploraciones complementarias, que confirmen el diagnóstico de un síndrome o enfermedad.', '', 1, 30);
